import { StatusBar } from 'expo-status-bar';
import React from "react";
import { createAppContainer } from "react-navigation";
import { createDrawerNavigator } from "react-navigation-drawer";
import { Dimensions } from "react-native";
import { Feather } from "@expo/vector-icons";

import {
  LedgerScreen,
  StatisticsScreen,
  NotificationsScreen,
  OrdersScreen,
  ReportsScreen,
  ProfileScreen,
  SettingsScreen,
  HelpScreen,
  LogOutScreen,
} from "./screens";

import SideBar from "./components/SideBar";

const DrawerNavigator= createDrawerNavigator(
  {
    LedgerScreen:{
      screen: LedgerScreen,
      navigationOptions: {
        title: "Ledger",
        drawerIcon: ({tintColor})=><Feather name="book" size={25} color={tintColor}/>
      }
    },
    StatisticsScreen:{
      screen: StatisticsScreen,
      navigationOptions: {
        title: "Statistics",
        drawerIcon: ({tintColor})=><Feather name="activity" size={25} color={tintColor}/>
      }
    },
    NotificationsScreen:{
      screen: NotificationsScreen,
      navigationOptions: {
        title: "Notifications",
        drawerIcon: ({tintColor})=><Feather name="bell" size={25} color={tintColor}/>
      }
    },
    OrdersScreen:{
      screen: OrdersScreen,
      navigationOptions: {
        title: "Orders",
        drawerIcon: ({tintColor})=><Feather name="shopping-cart" size={25} color={tintColor}/>
      }
    },
    ReportsScreen:{
      screen: ReportsScreen,
      navigationOptions: {
        title: "Reports",
        drawerIcon: ({tintColor})=><Feather name="book-open" size={25} color={tintColor}/>
      }
    },
    ProfileScreen:{
      screen: ProfileScreen,
      navigationOptions: {
        title: "Profile",
        drawerIcon: ({tintColor})=><Feather name="user" size={25} color={tintColor}/>
      }
    },
    SettingsScreen:{
      screen: SettingsScreen,
      navigationOptions: {
        title: "Settings",
        drawerIcon: ({tintColor})=><Feather name="settings" size={25} color={tintColor}/>
      }
    },
    HelpScreen:{
      screen: HelpScreen,
      navigationOptions: {
        title: "Help",
        drawerIcon: ({tintColor})=><Feather name="help-circle" size={25} color={tintColor}/>
      }
    },
    LogOutScreen:{
      screen: LogOutScreen,
      navigationOptions: {
        title: "Log Out",
        drawerIcon: ({tintColor})=><Feather name="log-out" size={25} color={tintColor}/>
      }
    },
  },
  {
    contentComponent: props=><SideBar{...props}/>,

    drawerWidth: Dimensions.get("window").width*0.75,
    hideStatusBar: true,

    contentOptions: {
      activeBackgroundColor: "rgba(0,0,255,0.1)",
      //activeTintColor: ""                                         //Blue color by default,change if required
    }
  }
);

export default createAppContainer(DrawerNavigator);
